import Student from "./components/Student";
import SignInForm from "./components/forms/SignInForm";

// import components
import Header from "./components/header/Header";
// import Navigation from "./components/header/Navigation";

function App(props) {
  return (
    <div className="App">
      <Header props={props} />
      <Switch>
        <Route exact path="/" />
        <PrivateRoute path="/student" component={Student} props={props} />
        <PrivateRoute path="/volunteer" component={Volunteer} props={props} />
        <Route exact path="/login" component={SignInForm} props={props} />
        {/* <Route exact path="/login">
							<SignInForm props={props} signInState={props.signInState} />
						</Route> */}
      </Switch>
    </div>
  );
}

export default App;
